import { Header } from "../../components/Header/header.js";
import Box from "@mui/material/Box";
import { styled } from "@mui/system";
import * as React from 'react';
import defaultImage from './default.png';
import Typography from "@mui/material/Typography";

const StyledLabel = styled('p')({
    fontWeight:'bold',
    marginRight: '1vw',
    fontSize: 'calc(0.4em + 1vw)'
});

const StyledText = styled('p')({
    fontSize: 'calc(0.4em + 1vw)',
    fontWeight: 'normal'
});

export const Profile = () => {
    return (
        <Box sx={{border:'1px solid black', width: '85vw', height: '77.69vh', display: 'flex'}}>
            <Box sx={{height: '77.69vh', width: '55vw', border:'1px solid black', display:'flex', flexDirection:'column'}}>
                <Box sx={{border:'1px solid black', width:'55vw', height:'30vh', display:"flex", justifyContent:"center", alignItems:"center"}}>
                    <Box sx={{width:"15.5vw", height:"15.5vw", background:"linear-gradient(rgba(145, 70, 216, 1), rgba(213, 253, 81, 1))", display:"flex", alignItems:"center", justifyContent:"center", borderRadius:"40%"}}>
                        <Box component="img" sx={{height:"15vw", width:"15vw", borderRadius:"40%"}} src={defaultImage} />
                    </Box>
                    <Box sx={{display:"flex", flexDirection:"column", height:"15vw", border:"1px solid black", fontWeight:"bold", justifyContent:"space-between"}}>
                        <Typography sx={{color:"rgba(145, 70, 216, 1)", textAlign:"center"}}>Default Player</Typography>
                        <Box sx={{display:"flex"}}>
                            <StyledLabel>Age: </StyledLabel>
                            <StyledText>N/A</StyledText>
                        </Box>
                        <Box sx={{display:"flex"}}>
                            <StyledLabel>Sex: </StyledLabel>
                            <StyledText>N/A</StyledText>
                        </Box>
                        <Box sx={{display:"flex"}}>
                            <StyledLabel>Region: </StyledLabel>
                            <StyledText>N/A</StyledText>
                        </Box>
                        <Box sx={{display:"flex"}}>
                            <StyledLabel>Plays: </StyledLabel>
                            <StyledText>N/A</StyledText>
                        </Box>
                    </Box>
                </Box>
                <Box sx={{border:'1px solid black', width:'30vw'}}>

                </Box>
            </Box>
            <Box sx={{height: '77.69vh', width:'30vw', border:'1px solid black'}}>

            </Box>
        </Box>
    );
}
